import React from 'react';


function Portfolio(props) {
    const currentWork = {
        name: "Simple Doc",
        description: "Manages small hospital Patience, Nurses and Doctors."
    };
    return(
        <section>
            <h1>{currentWork.name}</h1>
            <p>{currentWork.name}</p>
        </section>
    );
}
export default Portfolio
